import React from 'react'
import ProfileCard from './ProfileCard/ProfileCard'

function ProfileSection() {
  return (
    <div>
        <ProfileCard props={{title:"LeetCode",imgUrl:"lc.png",profileUrl:"https://leetcode.com/tush27/"}}/>
        <ProfileCard props={{title:"GeeksForGeeks",imgUrl:"gfg.png",profileUrl:"https://auth.geeksforgeeks.org/user/ttusharbe19/practice/"}}/>
        <ProfileCard props={{title:"Coding Ninjas",imgUrl:"cn.jpg",profileUrl:"https://leetcode.com/tush27/"}}/>
    </div>
  )
}

export default ProfileSection
